import React from 'react';

//Styling
import { createMuiTheme } from '@material-ui/core/styles';

import { Button, TextField, FormControl, DialogActions } from '@material-ui/core';

const theme = createMuiTheme({
    overrides:{
        MuiFormControl:{
            fullWidth: true,
        }
    }
});

export default function FormContent() {
    return (
        <form>
            {/* <FormControl theme={theme}> */}
                <TextField
                    autoFocus
                    margin="dense"
                    id="name"
                    label="Email Address"
                    type="email"
                    fullWidth
                />
            {/* </FormControl> */}
        </form>
    );
}
